import React, { Component } from 'react';
import Project from './Project';
import socialProfile from './data/socialProfile';
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      displayBio: false
    };
  }
  readMore=()=> {
    this.setState({ displayBio:!this.state.displayBio })
  }
  render() {
    return (
      <div>
        <h1>HI hello</h1>
        <p>i m raza i did mcs from university if karachi</p>
        <div>
          {
            this.state.displayBio ? (
              <div>
                <h1>ali raza as a mern full developre</h1>
                <button onClick={this.readMore}>Read less</button>
              </div>
            ) : (
                <div><button onClick={this.readMore}>Read More</button></div>
              )
          }
        </div>
        <hr/>
        <Project/>
        <socialProfile/>
      </div>

    );
  }
}

export default App;
